def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = False
    for char in prefix:
        if char == ' ':
            current_column += 1
        elif char == '\t':
            current_column += 4  # Assuming tab width is 4 spaces
        elif char == '\n':
            if wait_for_nl:
                if current_line.strip() and current_column < column:
                    res = ''.join(lines)
                    return res, prefix[len(res):]
                lines.append(current_line)
                current_line = ""
                current_column = 0
                wait_for_nl = False
            current_column = 0  # Reset column count for new line
        else:
            current_line += char
            wait_for_nl = True

    return ''.join(lines) + current_line, ""
